import SkillScale from "./SkillScale";

const mobilePhones = [
    { name: 'Samsung Galaxy', id: 1 },
    { name: 'Nokia 3310', id: 2 },
    { name: 'Blackberry XZ', id: 3 },
];

function ShoppingList() {
    const smartphones = mobilePhones.map(mobilePhone => 
        <div className="product__smartphone">
            <li key={mobilePhone.id}>{mobilePhone.name}</li>
        </div>
    );

    return (
        <div>
            <h1>Produits</h1>
            <ul>{smartphones}</ul>
            <SkillScale scaleValue={mobilePhones.batteryHours} />
        </div>
    );
}

export default ShoppingList;
